<html xmlns="http://www.w3.org/1999/xhtml" >
<head>
		<title>CUBIT Launch</title>
		<meta http-equiv="Content-Type" content="text/html; charset=windows-1252" />
		<meta name="GENERATOR" content="Microsoft FrontPage 4.0" />
		<meta name="ProgId" content="FrontPage.Editor.Document" />
</head>
	<body>
	    <script type="text/javascript" language="JavaScript">
            
            window.onload = loadapp; 

            function loadapp()
            { 
                var win = window.open('FeedMain.aspx?from=launch','ApplicWindowZ',
                'titlebar=no,toolbar=no,directories=no,status=yes,scrollbars=no,resizable=yes,resize=no,menubar=no,height=685,width=1014,top=0,left=0');
                win.moveTo(0,0);
                if (win) {
                    window.open('', '_parent', '');
                    self.opener = this;
                    self.close();
                }
            }
        </script>
	</body>
</html>
